import React from "react";
import styles from "./MainSection.module.css";
import faro from "../../img/faro.png";

const MainSection = () => {
	return (
		<section className={styles.section}>
			<div className={styles.left}>
				<img className={styles.img} alt="Imagen del faro" src={faro} />
			</div>
			<div className={styles.right}>
				<div className={styles.divText}>
					<h1>Digitalizar tus téxtos ahora es mas fácil y rápido</h1>
					<p>
						JAMER digitalizer es la herramienta que te permite convertir
						imagenes con texto a otros formatos, disponible en npm.
					</p>
				</div>
			</div>
		</section>
	);
};

export default MainSection;
